import MessagesCss from './Messages.module.css'
import Dialog from './Dialog/Dialog'
import Message from './Message/Message'

let DialogData = [
    {name:'Антон', id:'1'},
    {name:'Петр',id:'2'},
    {name:'Вася',id:'3'},
    {name:'Стас',id:'4'},
    {name:'Юля',id:'5'},
    {name:'Леха',id:'6'}
]

let dialogs = DialogData.map(dialog => <Dialog name={dialog.name} id ={dialog.id}/>)

let messageData = [
{text:'Ку'},
{text:'Ты как?'},
{text:'Все хорошо?'}
]

let messagesElements = messageData.map(message => <Message text={message.text}/>)

let Messages = (props) => {
    return (
        <div className={MessagesCss.content}>
            <div className={MessagesCss.dialogs}>
            {dialogs}
            </div>
            <div className={MessagesCss.messages}>
                  {messagesElements}
            </div>
        </div>

    )
}

export default Messages
